import styled from 'styled-components';

export const About = styled.div`
    width: 95vw;
    height: 900px;
`;

export const Header = styled.section`
    color:white;
    position: sticky;
`;

export const Body = styled.section`
    background-color: white;
    height: 1900px;
`;
